import React from 'react';
import Post from './Post/Post';
import MyPost from './MyPosts/MyPosts';
import image from '../image/dow.jpg';

import s from './Profile.module.css';

const Profile = () => {
  return (
    <div className={s.content}>
      <div className='image'>
        <img src={image} />
      </div>
      <div>ava + description</div>
      <div>My posts</div>
      <form>
        <textarea rows='12px' cols='13px'></textarea>
        <button>add text</button>
        <button>remove</button>
      </form>
      <div>New Post</div>
      <div className='posts'>
        <Post msg='barior axperner' />
        <Post msg='inchka chka' />
      </div>
    </div>
  );
};

export default Profile;
